import React from 'react'
import { Bar, Line, Doughnut } from 'react-chartjs-2';

const Statistics = () => {
    const data = {
        labels: ["January", "February", "March", "April", "May", "June", "July"],
        datasets: [{
            label: "Grafica 1",
            backgroundColor: '#4a00e0',
            borderColor: 'white',
            data: [3, 10, 5, 2, 20, 30, 45],
        }]
    }
    const options = {
        scales: {
            xAxes: [{
                gridLines: {
                    offsetGridLines: true
                }
            }]
        }
    };

    return (
        <>
            <div className='row'>
                <div className='col-sm-6'>
                    <div className="card">
                        <Bar
                            data={data}
                            options={options}
                            width={300}
                            height={150}
                        />
                    </div>
                </div>
                <div className='col-sm-6'>
                    <div className="card">
                        <Bar
                            data={data}
                            options={options}
                            width={300}
                            height={150}
                        />
                    </div>
                </div>

                <div className='col-sm-6'>
                    <div className="card">
                        <Line
                            data={data}
                            options={options}
                            width={300}
                            height={150}
                        />
                    </div>
                </div>
                <div className='col-sm-6'>
                    <div className='card' >
                        <Doughnut
                            data={data}
                            options={options}
                            width={300}
                            height={150}
                            className="card_dashboard"
                        />
                    </div>
                </div>
            </div>
        </>
    );
}


export default Statistics;
